const express = require('express');
const app = express();
const port = process.env.PORT || 5000;

app.get('/', (req, res) => {

  res.send('<h3> HELLO </h3>');
})

app.listen(port, (req, res) => {
console.log(`server listening on port: ${port}`)
 });
